import React, { Component } from 'react';
import {Link} from 'next'

class Index extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }
  render() {
    return (
      <React.Fragment>
              <Link href='/about'></Link>

      </React.Fragment>
    )
  }
}

export default Index;
